// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

interface CrowdsaleForRetail {
    function joined(address account) external view returns (uint256);
}

contract AirdropUnlimited is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    event transferToken(address wallet, address account, uint256 amount);

    IERC20 public token;
    address public tokenWallet;
    uint256 public minDAOBalanceAmount;
    uint256 public minDATStakeAmount;
    uint256 public airdropMaxAmount;
    address public crowdsaleForRetailAddress;

    CrowdsaleForRetail private crowdsaleForRetail;

    bool public checkRelationshipListSwitch = false;
    bool public checkDAOBalanceOrDATStakeSwitch = true;
    bool public checkDAOBalanceSwitch = false;
    bool public checkDATStakeSwitch = false;

    // relationshipList
    struct Relationship {
        address token;
        bool isRemove;
        address[] member;
    }
    mapping (address => Relationship) private _relationshipList;

    // Record the information of all invited personnel
    struct InviteInfo {
        address inviterToken;
        uint256 airdropAmount;
    }
    mapping (address => InviteInfo) public airdropList;

    // Report Record the information of all invited personnel
    struct ReportInviteInfo {
        address token;
        address inviterToken;
        uint256 amount;
    }

    constructor(
        IERC20 _token,
        address _tokenWallet,
        uint256 _minDAOBalanceAmount,
        uint256 _minDATStakeAmount,
        uint256 _airdropMaxAmount,
        address _crowdsaleForRetailAddress
    ) Ownable() {
        require(address(_token) != address(0), "Airdrop: The token is the zero address");
        require(_tokenWallet != address(0), "Airdrop: The token wallet is the zero address");

        token = _token;
        tokenWallet = _tokenWallet;
        minDAOBalanceAmount = _minDAOBalanceAmount;
        minDATStakeAmount = _minDATStakeAmount;
        airdropMaxAmount = _airdropMaxAmount;
        crowdsaleForRetailAddress = _crowdsaleForRetailAddress;

        crowdsaleForRetail = CrowdsaleForRetail(_crowdsaleForRetailAddress);
    }

    // set minDAOBalanceAmount
    function setMinDAOBalanceAmount(uint256 amount) public onlyOwner {
        minDAOBalanceAmount = amount;
    }
    // set minDATStakeAmount
    function setMinDATStakeAmount(uint256 amount) public onlyOwner {
        minDATStakeAmount = amount;
    }
    // set airdropMaxAmount
    function setAirdropMaxAmount(uint256 amount) public onlyOwner {
        airdropMaxAmount = amount;
    }
    // open and close checkRelationshipListSwitch
    function openCheckRelationshipListSwitch() public onlyOwner {
        checkRelationshipListSwitch = true;
    }
    function closeCheckRelationshipListSwitch() public onlyOwner {
        checkRelationshipListSwitch = false;
    }
    // open and close checkDAOBalanceOrDATStakeSwitch
    function openCheckDAOBalanceOrDATStakeSwitch() public onlyOwner {
        checkDAOBalanceOrDATStakeSwitch = true;
    }
    function closeCheckDAOBalanceOrDATStakeSwitch() public onlyOwner {
        checkDAOBalanceOrDATStakeSwitch = false;
    }
    // open and close checkDAOBalanceSwitch
    function openCheckDAOBalanceSwitch() public onlyOwner {
        checkDAOBalanceSwitch = true;
    }
    function closeCheckDAOBalanceSwitch() public onlyOwner {
        checkDAOBalanceSwitch = false;
    }
    // open and close checkDATStakeSwitch
    function openCheckDATStakeSwitch() public onlyOwner {
        checkDATStakeSwitch = true;
    }
    function closeCheckDATStakeSwitch() public onlyOwner {
        checkDATStakeSwitch = false;
    }

    /**
     * @dev get DAO balance amount of account.
     * @param account the address
     * @return uint256
     */
    function getDaoBalance(address account) public onlyOwner view returns (uint256) {
        return token.balanceOf(account);
    }

    /**
     * @dev get DAT stake amount of account.
     * @param account the address
     * @return uint256
     */
    function getDatStake(address account) public onlyOwner view returns (uint256) {
        return crowdsaleForRetail.joined(account);
    }

    /**
     * @dev get member list from the relationshipList by owner
     */
    function getMemberListByOwner(address account) public onlyOwner view returns (address[] memory) {
        return _getMemberList(account);
    }

    /**
     * @dev get member list from the relationshipList by owner
     */
    function getMemberList() public view returns (address[] memory) {
        require(hasRelationshipList(msg.sender), "Airdrop: The account is not in the relationshipList");
        return _getMemberList(msg.sender);
    }

    /**
     * @dev get member list from the relationshipList
     */
    function _getMemberList(address account) internal view returns (address[] memory) {
        Relationship memory info = _relationshipList[account];
        return info.member;
    }

    /**
     * @dev remove single account from the relationshipList by owner
     * @param account the address of relationshipList
     */
    function removeFromRelationshipList(address account) public onlyOwner {
        require(hasRelationshipList(account), "Airdrop: The account is not in the relationshipList");
        Relationship storage info = _relationshipList[account];
        info.isRemove = true;
    }

    /**
     * @dev add account list to the relationshipList by owner
     * @param accountList the address of relationshipList
     */
    function addMutliToRelationshipList(address[] memory accountList) public onlyOwner {
        require(accountList.length > 0, "Airdrop: The account list is null");
        for (uint i = 0; i < accountList.length; i++) {
            _addToRelationshipList(accountList[i]);
        }
    }

    /**
     * @dev add single account to the relationshipList by owner
     * @param account the address of relationshipList
     */
    function addToRelationshipList(address account) public onlyOwner {
        require(!hasRelationshipList(account), "Airdrop: The account is already on the relationshipList");
        _addToRelationshipList(account);
    }

    /**
     * @dev add account to the relationshipList
     * @param account the address of relationshipList
     */
    function _addToRelationshipList(address account) internal {
        Relationship storage info = _relationshipList[account];
        if (info.token != address(0)) {
            info.isRemove = false;
        } else {
            _relationshipList[account] = Relationship(account, false, new address[](0));
        }
    }

    /**
     * @dev add account list to the airdropList by owner
     * @param list the address of airdropList
     */
    function addMutliToAirdropList(ReportInviteInfo[] memory list) public onlyOwner {
        require(list.length > 0, "Airdrop: The invite info list is null");
        for (uint i = 0; i < list.length; i++) {
            ReportInviteInfo memory reportInfo = list[i];
            if (reportInfo.amount >= 0 && !hasAirdropList(reportInfo.token)) {
                uint256 formatAmount = reportInfo.amount * (10**uint256(18));
                _receiveAirdrop(reportInfo.token, reportInfo.inviterToken, formatAmount, false);
            }
        }
    }

    /**
     * @dev Check if an account has this relationshipList.
     * @param account the address of relationshipList
     * @return bool
     */
    function hasRelationshipList(address account) public view returns (bool) {
        require(address(account) != address(0), "Airdrop: The account is the zero address");
        Relationship memory relationshipListInfo = _relationshipList[account];
        return relationshipListInfo.token != address(0) && !relationshipListInfo.isRemove;
    }

    /**
     * @dev Check if an account has this airdroplist.
     * @param account the address
     * @return bool
     */
    function hasAirdropList(address account) public view returns (bool) {
        require(address(account) != address(0), "Airdrop: The account is the zero address");
        InviteInfo memory inviteInfo = airdropList[account];
        return inviteInfo.inviterToken != address(0);
    }

    /**
     * @dev Check if an account DAO balance.
     * @param account the address
     * @return bool
     */
    function checkDaoBalance(address account) public view returns (bool) {
        uint256 accountBalance = token.balanceOf(account);
        uint256 formatMinDAOBalanceAmount = minDAOBalanceAmount * (10**uint256(18));
        return accountBalance >= formatMinDAOBalanceAmount;
    }

    /**
     * @dev Check if an account DAO balance.
     * @param account the address
     * @return bool
     */
    function checkDatStake(address account) public view returns (bool) {
        uint256 accountStakeAmount = crowdsaleForRetail.joined(account);
        uint256 formatMinDATStakeAmount = minDATStakeAmount * (10**uint256(18));
        return accountStakeAmount >= formatMinDATStakeAmount;
    }

    /**
     * @dev Receive airdrop
     * @param inviterAccount the account of receive's inviter
     */
    function receiveAirdrop(address inviterAccount) public {
        require(inviterAccount != address(0), "Airdrop: The inviter account is the zero address");
        require(inviterAccount != msg.sender, "Airdrop: The inviter account cannot be yourself");
        require(!hasAirdropList(msg.sender), "Airdrop: The invitee account is already on the airdropList");

        if (checkRelationshipListSwitch) {
            require(hasRelationshipList(inviterAccount), "Airdrop: The inviter account is not in the relationshipList");
        }
        if (checkDAOBalanceOrDATStakeSwitch) {
            require(checkDaoBalance(inviterAccount) || checkDatStake(inviterAccount), "Airdrop: Account does not meet the requirements");
        } else {
            if (checkDAOBalanceSwitch) {
                require(checkDaoBalance(inviterAccount), "Airdrop: Account balance does not meet the requirements");
            }
            if (checkDATStakeSwitch) {
                require(checkDatStake(inviterAccount), "Airdrop: Stake amount does not meet the requirements");
            }
        }

        // random to airdrop amount
        uint256 actualAmount = _getActualAmount();

        // exec receiveAirdrop
        _receiveAirdrop(msg.sender, inviterAccount, actualAmount, true);
    }

    /**
     * @dev Receive airdrop
     * @param currentAccount the account of operationer
     * @param inviterAccount the account of receive's inviter
     * @param amount Get actual amount
     * @param isTransfer Whether to transfer
     */
    function _receiveAirdrop(address currentAccount, address inviterAccount, uint256 amount, bool isTransfer) private {
        // add to airdropList
        airdropList[currentAccount] = InviteInfo(inviterAccount, amount);
        
        // add to relationshipList member
        Relationship storage relationshipListInfo = _relationshipList[inviterAccount];
        if (relationshipListInfo.token != address(0)) {
            relationshipListInfo.member.push(currentAccount);
        } else {
            _relationshipList[inviterAccount] = Relationship(inviterAccount, false, new address[](0));
            _relationshipList[inviterAccount].member.push(currentAccount);
        }
        
        if (isTransfer) {
            // transfer token to receive account
            token.safeTransferFrom(tokenWallet, currentAccount, amount);
            
            emit transferToken(tokenWallet, currentAccount, amount);
        }
    }

    /**
     * @dev Get actual amount
     */
    function _getActualAmount() internal view returns(uint256) {
        // random to airdrop amount
        uint256 randomAmount = _rand(airdropMaxAmount);
        if (randomAmount < 1) {
            randomAmount = 1;
        } else if (randomAmount > airdropMaxAmount) {
            randomAmount = airdropMaxAmount;
        }
        uint256 actualAmount = randomAmount * (10**uint256(18));
        return actualAmount;
    }

    /**
     * @dev Generate random numbers
     * @param length Random number range
     */
    function _rand(uint256 length) internal view returns(uint256) {
        uint256 random = uint256(keccak256(abi.encodePacked(block.difficulty, block.timestamp)));
        return random % length;
    }

    function killSelf(address payable recipientToken) public onlyOwner {
        uint256 contractBalance = token.balanceOf(address(this));
        token.safeTransfer(recipientToken, contractBalance);

        selfdestruct(recipientToken);
    }
}

